import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the price filter visible, we first need to perform a search
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('headphones');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_term_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_term_entered.png'));

    // There are multiple search buttons, target the one in the main search container
    const searchButton = page.locator('.search-container .search-btn');
    await searchButton.click();

    // Wait for the price filter to appear after the search results are loaded
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results_with_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results_with_filter.png'));

    // Fill in the minimum price
    const minPriceInput = page.locator('#minPrice');
    await minPriceInput.fill('100');

    // Fill in the maximum price
    const maxPriceInput = page.locator('#maxPrice');
    await maxPriceInput.fill('350');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_range_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_range_filled.png'));

    // Click the apply filter button
    const applyButton = page.getByRole('button', { name: 'Apply' });
    await applyButton.click();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_filter_applied.png'));

    // Extract data to verify the action
    const minPriceValue = await minPriceInput.inputValue();
    const maxPriceValue = await maxPriceInput.inputValue();

    return {
      success: true,
      action: "Applied price range filter from $100 to $350",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
